import React from "react";
import { Worker } from "./Worker";

const WorkersList = (props) => {
  return (
    <div>
      <ul>
        {props.list.map((worker) => (
          <Worker key={worker.id}>
            {worker.name}
            {worker.surname}
            {worker.sex}
            {worker.birthDate}
            {worker.salary}
            {worker.department}
          </Worker>
        ))}
      </ul>
    </div>
  );
};

export default WorkersList;
